import React from 'react'
import './CSS/style.css'
import { Link } from 'react-router-dom';

const Nav = () => {
  return (
    <>
    <div className="navBar">
        <Link to="/" className='Home'>Home</Link>
    </div>
    </>
  )
}

export default Nav
